import React from 'react';
import { useLocation } from 'react-router-dom';

const ResultPage = () => {
  const location = useLocation();
  const { resultData } = location.state;

  return (
    <div>
      <h1>Loan Prediction Result</h1>
      <p><strong>Full Name:</strong> {resultData.Full_Name}</p>
      <p><strong>Address:</strong> {resultData.Address}</p>
      <p><strong>PAN Number:</strong> {resultData.PAN_Number}</p>
      <p><strong>Loan Amount:</strong> {resultData.Loan_Amount}</p>
      <p><strong>EMI:</strong> {resultData.EMI}</p>
      <p><strong>Interest Rate:</strong> {resultData.Interest_Rate}</p>
      {/* Display other fields similarly */}
    </div>
  );
};

export default ResultPage;
